import React from 'react'

export default function ReviewList({reviewList}) {

  return (

    <div>
      <h2 className='reviewList'>리뷰 리스트</h2>
      <p>{reviewList.length}개의 리뷰가 있습니다.</p>
      <div>
        {reviewList.map( (list) => (
            <div key={list.id}>
                <p>영화 제목 : {list.title}</p>
                <p>리뷰: {list.content}</p>
                <p>평점 : {list.emotion}</p>
                <p>작성 시간 : {list.create_date}</p>
            </div>
        ))}

      </div>
    </div>
  )
}
